        internal async Task SetAnimation(ImageSource source, LottieAnimationView animationView)
        {
            string uri = "";
            string fileName = "";
            try
            {

                Log.Error(LogTag, $"Called SetAnimation");
                if (source == null)
                {
                    Log.Error(LogTag, $"source is null");

                    return;
                }

                if (source is UriImageSource uriImageSource)
                {
                    Log.Error(LogTag, $"Source is uri image source");

                    uri = uriImageSource.Uri?.OriginalString;

                    Log.Error(LogTag, $"Source uri is: {uri}");


                    if (string.IsNullOrWhiteSpace(uri))
                        return;

                    animationView.SetAnimationFromUrl(uriImageSource.Uri.AbsoluteUri);

                    return;
                }


                if (source is FileImageSource fileImageSource)
                {
                    Log.Error(LogTag, $"Source is file image source");

                    //Log.Error(LogTag, $"File path is {fileImageSource.File}");

                    fileName = fileImageSource.File;

                    bool doesExist = File.Exists(fileName);

                    if (!doesExist)
                    {
                        throw new NotSupportedException($"File doesn't exist: {fileName}");
                    }

                    string fileToSave = File.ReadAllText(fileName);

                    //if (string.IsNullOrWhiteSpace(fileName))
                    //    return;

                    //animationView.SetAnimation(fileName);

                    Log.Error(LogTag, $"Json File is {fileToSave}");

                    LoadAnimationTCS = new TaskCompletionSource<object>();

                    Log.Error(LogTag, $"Create Tcs hashcode: {LoadAnimationTCS.GetHashCode()}");


                    //var lottieTask = LottieCompositionFactory.FromJsonString()






                    LottieComposition.Factory.FromJsonString(fileToSave, OnLoaded);

                    var t = await LoadAnimationTCS.Task;
                    LoadAnimationTCS = new TaskCompletionSource<object>();
                    Log.Error(LogTag, $"Task Result passed");


                    return;
                }

                //if (source is StreamImageSource streamImageSource)
                //{
                //    var stream = await streamImageSource.Stream;


                //    LottieCompositionFactory.FromJsonInputStream(streamImageSource.Stream, "Bla");

                //    animationView.setan
                //}

                Log.Error(LogTag, $"Source type not supported");


                throw new NotImplementedException("ImageSource type not supported");
            }
            catch (Exception e)
            {
                Log.Error(LogTag, $"Uri is {uri}\n FileName is {fileName}\nSet Animation failed: {e}");


                Console.WriteLine(e);
                throw;
            }
        }
        void OnLoaded(LottieComposition composition)
        {
            Log.Error(LogTag, $"Composition is {composition}");
            Log.Error(LogTag, $"Animation.Composition is {_animationView.Composition}");

            _animationView.Composition = composition;
            Log.Error(LogTag, $"Animation.Composition is now {_animationView.Composition}");
            //animationView.PlayAnimation();
            //Log.Error(LogTag, $"Called playanimation");
            Log.Error(LogTag, $"Set result");
            Log.Error(LogTag, $"Loaded Tcs hashcode: {LoadAnimationTCS.GetHashCode()}");

            LoadAnimationTCS.SetResult(true);
        }
    }
